import {
    precompileTemplate
} from "@ember/template-compilation";
export default precompileTemplate("{{#if this.category}}\n  <div class=\"category-status\" aria-hidden=\"true\">\n    {{#if this.hasParentCategory}}\n      {{#unless this.hideParentCategory}}\n        {{this.badgeForParentCategory}}\n      {{/unless}}\n    {{/if}}\n    {{this.badgeForCategory}}\n  </div>\n\n  {{#if this.shouldDisplayDescription}}\n    <div class=\"category-desc\" aria-hidden=\"true\">{{dir-span this.descriptionText htmlSafe=\"true\"}}</div>\n  {{/if}}\n{{else}}\n  {{html-safe this.label}}\n{{/if}}", {
    moduleName: "select-kit/components/none-category-row.hbs"
});